import { Button } from "govuk-react";

interface Props {
  type: string;
}

let color = "";

const UserButton = ({ type }: Props) => {
  if (type == "Doctor") {
    color = "#00b043";
  } else if (type == "Admin") {
    color = "#001eff";
  } else if (type == "Patient") {
    color = "#adadad";
  }

  return (
    <>
      <Button buttonColour={color}>{type} Page</Button>
    </>
  );
};

export default UserButton;
